import React from 'react';
import UploadBar from './UploadBar'
import './css/Main.css'

const TO_DISPLAY = 8;

class Main extends React.Component {
    render() {
        return(
            <div class="center">
                <div class="row gy-4 main-grid  pt-3">
                    {
                        Array(TO_DISPLAY).fill(1).map((el, i) =>
                            <div class="col">
                                <div class="grid-item border border-secondary">Hello</div>
                            </div>
                        )
                    }
                </div>
                <UploadBar/>
            </div>
        )
    }
} 

export default Main;
